import { useQuery, gql } from '@apollo/client';
import React from 'react';

const GET_USER = gql`
  query($id: String!) {
    user(id: $id) {
      id
      fname
      lname
    }
  }
`;

export default function Test() {

    const {loading, error, data} = useQuery(GET_USER, {
        variable: {id: '1'}
});
if (loading) return <p>Loading...</p>;
if (error) return <p>Error: {error.message}</p>;
    return(
        <div>
            <p>Test</p>
            <p>{data.user.fname}</p>
        </div>
    )
}
